/*eslint-disable*/
import React from "react";

// reactstrap components
import { Row, Container, Col, Button} from "reactstrap";

function Gallary() {
  return (

      <div>
         <div className="row mainheading">
              <div className="col md-4"><hr className="home-border"/></div>
              <div  className=" col md-4  allmainnheading"><span className="allmainnheading1">Gallary</span><span className="allmainnheading2">Gallary</span></div>
              <div className="col  md-4 " ><hr className="home-border"/></div>
            </div>
            <div className="row mainheading">
              <div className="col md-4"><hr className="home-border"/></div>
              <div  className=" col md-4  allmainnheadinggallary"><span className="allmainnheadinggallary1">Sport Complex</span><span className="allmainnheading2">Sport Complex</span></div>
              <div className="col  md-4 " ><hr className="home-border"/></div>
            </div>

            <Container>
              <Row>
                <Col md="12">
                <img
                      alt="..."
                      className="img img-responsive"
                      src={require("assets/img/LawnsPagebanner.png").default}
                      style={{ width: "100%" }}
                    />
                </Col>
              </Row>
              
              <Row xs="1" sm="2" md="3">
                <Col>
                <img
                  alt="..."
                  className="img1 img-responsive1"
                  src={require("assets/img/Lawnshape.png").default}
                  style={{ width: "100%" }}
                />
                </Col>
                <Col>
                <Row>
                <img
                  alt="..."
                  className="img1 img-responsive1"
                  src={require("assets/img/Lawnshape.png").default}
                  style={{ width: "100%" }}
                />


                </Row>
                <Row>hh</Row>
                </Col>
                <Col><img
                  alt="..."
                  className="img1 img-responsive1"
                  src={require("assets/img/Lawnshape.png").default}
                  style={{ width: "100%" }}
                /></Col>

              </Row>



            </Container>
      </div>    
            
  );
}

export default Gallary;
